import React from 'react';
import styled from 'styled-components'
import Header from '../components/Header';
import Footer from '../components/Footer';

const About = () => {
    return (
        <AboutContainer>
            <Header />
            <h1>About</h1>
            <Footer />
        </AboutContainer>
    )
};

const AboutContainer = styled.div`
color: black;
`
export default About;
